import React from 'react'
import { NavLink } from 'react-router-dom'
// import Form from './Form'

const Navbar = () => {
    return (
        <>
            <NavLink to="/" > Home </NavLink>
            <NavLink to="/about" > About </NavLink>
            <NavLink to="/contact"> Contact</NavLink>
        </>

    )
}

export default Navbar
